import React, { useState } from "react";
import "./App.css";

function App() {
  const [pets] = useState([
    { id: 1, name: "Bella", species: "Dog", status: "Available" },
    { id: 2, name: "Luna", species: "Cat", status: "Adopted" },
    { id: 3, name: "Charlie", species: "Rabbit", status: "Available" }
  ]);

  return (
    <div className="app-container">
      <header className="header">
        <h1>üêæ PetsUnited</h1>
        <p>Animal Placement Dashboard</p>
      </header>

      <main className="main">
        <section className="pet-list">
          {pets.map(pet => (
            <div key={pet.id} className="pet-card">
              <h3>{pet.name}</h3>
              <p>Species: {pet.species}</p>
              <p>Status: {pet.status}</p>
            </div>
          ))}
        </section>
      </main>

      <footer className="footer">
        <p>¬© 2025 PetsUnited</p>
      </footer>
    </div>
  );
}

export default App;
